import style from "./style.module.scss";

const NotFound = () => {
  return (
    <>
    <div className={style.root}>
      <span>Страница не найдена</span>
    </div>
    <div className={style.discribtion}>К сожалению данная страница отсутствут в нашем интернет-магазине</div>
    </>
  );
};

export default NotFound;
